Now you have a bot, it's time to bring it to life! Create a new console project for your bot. It could be a .NET Core project or a .NET project targeting versions 4.5+. This guide uses .NET Core examples but full .NET framework projects work as well. dotnet new console Add a reference to Telegram.Bot package. dotnet add package Telegram.Bot Open Program.cs file and use the following content. Replace YOUR_ACCESS_TOKEN_HERE with the access token from Bot Father. using System;
using Telegram.Bot; namespace Awesome { class Program { static void Main() { var botClient = new TelegramBotClient("YOUR_ACCESS_TOKEN_HERE"); var me = botClient.GetMeAsync().Result; Console.WriteLine( $"Hello, World! I am user {me.Id} and my name is {me.FirstName}." ); } }
} Running the program gives you the following output: dotnet run Hello, World! I am user 123456789 and my name is Awesome Bot.

