Downloading a file from Telegram Bot API has 2 steps ( see docs here ): Get file info by calling getFile Download file from https://api.telegram.org/file/bot<token>/<file_path> GetFileAsync() is replaced by 3 methods. Method GetInfoAndDownloadFileAsync() looks very similar to old GetFileAsync() : // Gets file info and saves it to "path/to/file.pdf"
using (var fileStream = System.IO.File.OpenWrite("path/to/file.pdf"))
{ File fileInfo = await BotClient.GetInfoAndDownloadFileAsync( fileId: "BsdfgLg4Khdlsn-bldBD", destination: fileStream );
} Note that calling the method GetInfoAndDownloadFileAsync() results in 2 HTTP requests (steps 1 and 2 above) being sent to the Bot API. There are two more methods that assist you with downloading files: // New version of GetFileAsync() only gets the file info (step 1)
File fileInfo = await BotClient.GetFileAsync("BsdfgLg4Khdlsn-bldBD"); // Download file from server (step 2)
using (var fileStream = System.IO.File.OpenWrite("path/to/file.pdf")) { await BotClient.DownloadFileAsync( filePath: fileInfo.FilePath, destination: fileStream );
}

