Classes InlineQueryResultNew and InlineQueryResultCache are removed. InlineQueryResult has become the only shared base type for all inline query result classes. Many shared and redundant properties are removed. This might require significant changes to your .cs files if your bot is in inline mode . Fortunately, all input query results now have constructors with only the required properties as their parameters. This is the preferred way to instantiate input query result instances e.g.: Instead of: // bad way. easy to get exceptions
documentResult = new InlineQueryResultDocument
{ Id = "some-id", Url = "https://example.com/document.pdf", Title = "Some title", MimeType = "application/pdf"
}; You should use: // good way
documentResult = new InlineQueryResultDocument( id: "some-id", documentUrl: "https://example.com/document.pdf", title: "Some title", mimeType: "application/pdf"
);

