} Payment Settings [Required] Payment Provider Token This token is required for any test case regarding payments and must be provided before starting tests. Consult Telegram API documentations and talk to BotFather to get a test token from a payment provider. { /* ... */ "PaymentProviderToken": "MY-PAYMENT-PROVIDER-TOKEN" /* ... */
} TesterPrivateChatId Invoices could only be sent to private chats. If not set, bot will wait for a tester to send it /test command in a private chat. { /* ... */ "TesterPrivateChatId": 1234567890 /* ... */
} Chat Administration For this type of tests, bot should be a priviledged admin of that super group. Methods such as kick or unban will be performed on a regular (non-admin) tester in that chat. If the following 3 settings are not set, bot will ask a tester to send it /me command in a private chat with bot. Regular Member's User Id Regular Member's User Name Regular Member's Private Chat Id { /* ... */ "RegularMemberUserId": 1234567890, "RegularMemberUserName": "tester3", "RegularMemberPrivateChatId": 1234567890 /* ... */
